CREATE TABLE nas_alkis.feature_types (id smallint PRIMARY KEY, qname text NOT NULL);
COMMENT ON TABLE nas_alkis.feature_types IS 'Ids and bboxes of concrete feature types';
SELECT ADDGEOMETRYCOLUMN('nas_alkis', 'feature_types','bbox','0','GEOMETRY',2);
CREATE TABLE nas_alkis.gml_objects (id serial PRIMARY KEY, gml_id text UNIQUE NOT NULL, ft_type smallint REFERENCES nas_alkis.feature_types , binary_object bytea);
COMMENT ON TABLE nas_alkis.gml_objects IS 'All objects (features and geometries)';
SELECT ADDGEOMETRYCOLUMN('nas_alkis', 'gml_objects','gml_bounded_by','0','GEOMETRY',2);
ALTER TABLE nas_alkis.gml_objects ADD CONSTRAINT gml_objects_geochk CHECK (ST_IsValid(gml_bounded_by));
CREATE INDEX gml_objects_sidx ON nas_alkis.gml_objects  USING GIST (gml_bounded_by);